import React, { Component } from 'react';

import Container from '@material-ui/core/Container';


class Dashboard extends Component {
    render() {
        return (
            <Grid
                container
                direction="row"
                justify="center"
                alignItems="center"
            >
                <p>Teste</p>
            </Grid>
        )
    }
}

export default Dashboard
